  _detachReadyInterval() {

    if (this._readyInterval) {
      clearInterval(this._readyInterval)
      delete this._readyInterval
    }

  }

  _detachDisconnect() {

    if (this.__onDisconnect) {
      Process.off('disconnect', this.__onDisconnect)
      delete this.__onDisconnect
    }

  }

